var app=angular.module("VotingApp",[]);app.run(function(){});app.controller("VotingAppController",["$rootScope","$scope","$http",function(n,t,i){t.refresh=function(){i.get("api/Votes").then(function(n){t.votes=n})};t.remove=function(n){i.delete("api/Votes/"+n).then(function(){t.refresh()})};t.add=function(n){i.post("api/Votes/",{id:n}).then(function(){t.refresh();t.item=undefined})}}]);